ERROR - 2025-04-17 12:55:08 --> Query error: ERROR:  invalid byte sequence for encoding "UTF8": 0xde 0x6e - Invalid query: INSERT INTO "sm_cppt" ("id_layanan_pendaftaran", "waktu", "id_profesi", "subject", "objective", "assessment", "plan", "ademi_assesment", "ademi_diag", "ademi_interv", "ademi_monev", "sbar_situation", "sbar_background", "sbar_assesment", "sbar_recommend", "id_nadis", "ttd_nadis", "instruksi_ppa", "id_dokter_dpjp", "id_user", "konsul_via_telp", "konsul", "created_date") VALUES ('728915', '2025-04-17 12:41', '18', 'pasien mengatakan masih merasa nyeri pada luka post op, nyeri seperti di sayat-sayat, nyeri saat bergerak, nyeri hilang timbul

', 'A: Jalan nafas paten B: RR : 17x/menit, O2 Saturasi 98ngan room air, pengembangan dada simetris, Rhonki -/- C: akral hangat, nadi teraba kuat, CRT &lt; 3 detik, TD : 133/80 mmHg (MAP 93 mmHg ), Nadi 71 x/menit, Terpasang IVFD Tgl.16/04/2025 di Taka no. 20 RL + 4 amp oksitosin 12 tpm D: Kesadaran Compos Mentis GCS 15 E4M6V5, kekuatan otot 5/5/5/5. E: Suhu 36,6 C, Terpasang DC tgl.16/04/2025 produksi urine(+) kuning, diuresis 0.6 cc/kgbb/jam, Skala Plebitis 0, ekspresi meringis (+), Skala Nyeri VAS 3/10. Hasil lab tgl.16/4/2025 hb 10 ht 31 leuko 21.1 tr 255 hba1c 6,9 ureum 17 creatinin 0,5. post PRC 2 bag di meranti tgl 15/4/25. post Mgso4 20%. 4 gr bolus tgl 15/4/25. 

', 'Nyeri akut, Penurunan curah jantung, Risiko perdarahan

', 'Setelah dilakukan tindakan keperawatan 3x 24 jam Tingkat Nyeri Menurun dengan kriteria hasil: Kemampuan menuntaskan aktifitas meningkat, Keluhan nyeri menurun, Meringis menurun. Setelah dilakukan tindakan keperawatan selama 3x24 jam Curah jantung meningkat dengan KH: dispnoe menurun, takikardi meurun, gambaran EKG aritmia menurun, lelah menurun. Setelah dilakukan tindakan keperawatan selama 3x24 jam diharapkan tingkat perdarahan menurun dengan KH: kelembaban membran mukosa meningkat,kelembaban kulit meningkat,kognitif meningkat ,perdarahan vagina menurun,hemodinamik membaik,tekanan darah membaik,denyut nadi aipkal membaik.

', '', '', '', '', '', '', '', '', '2061', '1', 'Intervensi Mandiri<div>Identifikasi lokasi, karakteristik, durasi, frekuensi, kualitas, intensitas nyeri, Identifikasi skala nyeri, Identifikasi respons nyeri non verbal, Monitor tekanan darah ( termasuk tekanan darah ortostatik ), Identifikasi tanda dan gejala primer penurunan curah jantung, Monitor intake dan output cairan,Monitor tanda dan gejala perdarahan,monitor nilai hematokrit/homoglobin sebelum dan setelah kehilangan darah,monitor TTV,monitor koagulasi,pertahankan bedrest selama perdarahan,jelaskan tanda dan gejala perdarahan , Identifikasi gangguan fungsi tubuh yang mengakibatkan kelelahan.</div><div>Intervensi kolaborasi</div><div>- Observasi kesadaran, TD, N, RR,Diuresis, Perdarahan</div><div>- Boleh makan/minum</div><div>- cek DR post operasi HB 10</div><div>- sisa PRC 1 bag di bank darah sudah dibatalkan dengan yayat tgl 17/4/25</div><div>- R/ pindah ruangan, booking (+) dgn bd. ami</div>', NULL, '2061', 0, NULL, '2025-04-17 12:55:08')
